    false,nt"url": null,nt"notes": "This data set is a compilation of faults
    mapped by the United States Geological Survey (USGS) and published in USGS bulletin
    series 1028 (1956-1971). These bulletins are the last published attempt at mapping
    structure and stratigraphy of the Aleutians on an island-by-island basis. Only faults
    that manifest themselves on land were included in the USGS reports. Faults were
    transcribed from these bulletins onto the ESI maps. On the ESI maps, the faults
    are portrayed as linear features, with no map indication of their type (normal vs.
    thrust).This data set comprises a portion of the Environmental Sensitivity Index
    (ESI) data for Aleutians East Borough and Aleutians West Coastal Resource Service
    Area (CRSA). These data identify the marine and coastal environments and wildlife.
    The ESI data include information for three main components: shoreline habitats,
    sensitive biological resources, and human-use resources.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
